function getCookie(e){var t,n=new RegExp("(^| )"+e+"=([^;]*)(;|$)");return(t=document.cookie.match(n))?unescape(t[2]):null}function setCookie(e,t,n){var r=getsec(n),i=new Date;i.setTime(i.getTime()+r*1),document.cookie=e+"="+escape(t)+";expires="+i.toGMTString()}function getsec(e){var t=e.substring(1,e.length)*1,n=e.substring(0,1);if(n=="s")return t*1e3;if(n=="h")return t*60*60*1e3;if(n=="d")return t*24*60*60*1e3}function delCookie(e){var t=new Date;t.setTime(t.getTime()-1);var n=getCookie(e);n!=null&&(document.cookie=e+"="+n+";expires="+t.toGMTString())};